var Inkline = require("./Inkline");

var Portfolio = function(name) {
  this.name = name;
  this.inklines = {};
  this.inks = [];
};

Portfolio.prototype = {
  process: function(inkobj) {
    var inkline = inkobj.inkline || "default";
    if(!this.inklines[inkline]) {
      this.inklines[inkline] = new Inkline(this.name, inkline);
    }
    inkline = this.inklines[inkline];
    var ink = inkline.process(inkobj);
    this.inks.push(ink);
    return ink;
  },
  getName: function() {
    return this.name;
  },
  getInklines: function() {
    var inklines = this.inklines;
    return Object.keys(inklines).map(function(key) {
      return inklines[key];
    });
  },
  getInkline: function(name) {
    return this.inklines[name] || false;
  },
  getInks: function() {
    return this.inks;
  }
};

module.exports = Portfolio;
var Ink = require("./Ink");

var Inkline = function(name) {
  this.name = name;
  this.inks = {};
};

Inkline.prototype = {
  process: function(inkobj) {
    var inkname = inkobj.inkname;
    if(!this.inks[inkname]) {
      this.inks[inkname] = new Ink(inkobj);
    }
    return this.inks[inkname];
  },
  getName: function() { return this.name; }
};

module.exports = Inkline;
var Ink = function(obj) {
  var ink = this;
  Object.keys(obj).forEach(function(key) {
    ink[key] = obj[key];
  })
  this.name = this.inkname;
  delete this.inkname;
};

Ink.prototype = {
  getName: function() {
    return this.name;
  },
  matches: function(options) {
    return (this.name.matches(options.name));
  }
};

module.exports = Ink;
